import React, { useState } from "react";

const Formulario = () => {
    const [formData, setFormData] = useState({
        nombres: "",
        apellidos: "",
        pais: "",
        ciudad: "",
        sexo: "",
        edad: "",
        tipoEmprendimiento: "",
        subcategoriaPrincipal: "",
        subcategoriaSecundaria: ""
    });

    const [ciudadesDisponibles, setCiudadesDisponibles] = useState([]);
    const [subcategoriasPrincipales, setSubcategoriasPrincipales] = useState([]);
    const [opcionesDisponibles, setOpcionesDisponibles] = useState([]);
    const [errorEdad, setErrorEdad] = useState("");

    // Lista de ciudades por país
    const ciudadesPorPais = { 
        COLOMBIA: ["Bogotá D.C.", "Medellín", "Cali", "Barranquilla"],
        ARGENTINA: ["Buenos Aires", "Córdoba", "Rosario"],
        MÉXICO: ["Ciudad de México", "Guadalajara", "Monterrey"]
    };

    // Subcategorías principales
    const subcategoriasPorTipo = {
        PRODUCTOS: ["ALIMENTOS Y BEBIDAS", "MODA Y ACCESORIOS", "HOGAR Y JARDÍN"],
        SERVICIOS: ["Consultoría", "Educación y capacitación", "Marketing y publicidad"]
    };

    // Opciones que cargan según el tipo de emprendimiento
    const opcionesPorTipo = {
        PRODUCTOS: ["Venta en línea", "Tiendas físicas", "Distribución mayorista"],
        SERVICIOS: ["Consultoría personalizada", "Servicios en línea", "Atención presencial"]
    };

    const handleChange = (e) => {
        const { name, value } = e.target;

        if (name === "pais") {
            setCiudadesDisponibles(ciudadesPorPais[value] || []);
            setFormData({ ...formData, [name]: value, ciudad: "" });
        } else if (name === "tipoEmprendimiento") {
            setSubcategoriasPrincipales(subcategoriasPorTipo[value] || []);
            setOpcionesDisponibles(opcionesPorTipo[value] || []);
            setFormData({ ...formData, [name]: value, subcategoriaPrincipal: "", subcategoriaSecundaria: "" });
        } else if (name === "edad") {
            const nuevoValor = value.replace(/\D/g, "");
            setFormData({ ...formData, [name]: nuevoValor });

            if (nuevoValor && parseInt(nuevoValor, 10) < 18) {
                setErrorEdad("Debes ser mayor de edad, si eres menor no puedes inscribirte.");
            } else {
                setErrorEdad("");
            }
        } else {
            setFormData({ ...formData, [name]: value });
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (parseInt(formData.edad, 10) < 18) {
            alert("Debes ser mayor de edad, si eres menor no puedes inscribirte.");
            return;
        }
        console.log("Datos del formulario:", formData);
    };

    return (
        <form onSubmit={handleSubmit}>
            <label htmlFor="pais">País:</label>
            <select id="pais" name="pais" value={formData.pais} onChange={handleChange} required>
                <option value="">Selecciona un país</option>
                {Object.keys(ciudadesPorPais).map((pais) => (
                    <option key={pais} value={pais}>{pais}</option>
                ))}
            </select>

            <label htmlFor="ciudad">Ciudad:</label>
            <select id="ciudad" name="ciudad" value={formData.ciudad} onChange={handleChange} required>
                <option value="">Selecciona una ciudad</option>
                {ciudadesDisponibles.map((ciudad, index) => (
                    <option key={index} value={ciudad}>{ciudad}</option>
                ))}
            </select>

            <label htmlFor="nombres">Nombres:</label>
            <input type="text" id="nombres" name="nombres" value={formData.nombres} onChange={handleChange} required />

            <label htmlFor="apellidos">Apellidos:</label>
            <input type="text" id="apellidos" name="apellidos" value={formData.apellidos} onChange={handleChange} required />

            <label htmlFor="sexo">Sexo con el que te identificas:</label>
            <select id="sexo" name="sexo" value={formData.sexo} onChange={handleChange} required>
                <option value="">Selecciona una opción</option>
                <option value="FEMENINO">FEMENINO</option>
                <option value="MASCULINO">MASCULINO</option>
                <option value="OTRO">OTRO</option>
            </select>

            <label htmlFor="edad">Edad:</label>
            <input type="text" id="edad" name="edad" value={formData.edad} onChange={handleChange} required />
            {errorEdad && <p style={{ color: "red" }}>{errorEdad}</p>}

            <label htmlFor="tipoEmprendimiento">Mi emprendimiento se centra en:</label>
            <select id="tipoEmprendimiento" name="tipoEmprendimiento" value={formData.tipoEmprendimiento} onChange={handleChange} required>
                <option value="">Selecciona una opción</option>
                <option value="PRODUCTOS">PRODUCTOS</option>
                <option value="SERVICIOS">SERVICIOS</option>
            </select>

            <label htmlFor="subcategoriaPrincipal">Categoría principal:</label>
            <select id="subcategoriaPrincipal" name="subcategoriaPrincipal" value={formData.subcategoriaPrincipal} onChange={handleChange} required>
                <option value="">Selecciona una categoría</option>
                {subcategoriasPrincipales.map((subcategoria, index) => (
                    <option key={index} value={subcategoria}>{subcategoria}</option>
                ))}
            </select>

            <label htmlFor="opciones">Opciones según tipo de emprendimiento:</label>
            <select id="opciones" name="opciones" value={formData.opciones} onChange={handleChange} required>
                <option value="">Selecciona una opción</option>
                {opcionesDisponibles.map((opcion, index) => (
                    <option key={index} value={opcion}>{opcion}</option>
                ))}
            </select>

            <button type="submit">Enviar</button>
        </form>
    );
};

export default Formulario;
